CÁCH BIẾT CON SẮP ỐM: Mẻ Siro ho thứ 2 đã sẵn sàng phục vụ!!
Dịch bệnh thế này bố mẹ đừng để con phải đến Bệnh viện vì ốm giao mùa hay do nằm điều hoà nhé! Mình nuôi đứa đầu chưa có kinh nghiệm nên cũng từng suốt ngày mang con đi khám với cả XN máu… vì không biết quan sát dấu hiệu của con.
Đến đứa thứ 2 + nấu Siro Thiên Tri nên được nghe nhiều mẹ tâm sự thành ra mình càng ngày càng nhiều kinh nghiệm thực tế, giúp đỡ được nhiều em bé vượt qua hành trình “ốm để thích nghi” mà không cần dùng thuốc. Cách đơn giản nhất nhé:
“Ngày nào cũng phải xờ lòng bàn tay, bàn chân của con (nhất là giai đoạn chuyển mùa), thấy tay chân con nóng hơn (dù chưa ho, sổ mũi hay sốt gì hết) là đã phải vệ sinh mũi và cho con uống Siro húng chanh luôn rồi. Cho uống sớm thế thì có khi chỉ 1-2 hôm là con lại bình thường, chẳng ốm đau gì cả”. Khi con đã ho, sổ mũi, sốt thì sau đây là các việc bố mẹ nên làm:
- Uống Siro Thiên Tri pha nước ấm 3-5 lần/ ngày hoặc liên tục để bổ sung nước khi sốt (đây là nước lá củ quả thiên nhiên lành tính nên không sợ quá liều lượng);
- Vệ sinh mắt + mũi + họng bằng nước muối sinh lý;
- Con sốt thì lau trán, nách, bẹn bằng nước chanh pha nước ấm;
- Có thể Massage tinh dầu tràm gió tại huyệt dũng tuyền và luộc 1 quả trứng, nhét 1 đồng bạc vào trong ruột trứng, nhỏ 2-3 giọt tinh dầu tràm vào cái khăn mỏng rồi bọc quả trứng lại đánh cảm xuôi chiều cho con từ trên đầu xuống chân. 👉🏻 Khi tích cực làm đồng thời các cách trên thì:
- Bị ho sổi mũi thì 3-5 ngày sẽ khỏi
- Còn nếu là sốt virus thì sẽ kéo dài hơn (từ 7-10 ngày) nên bố mẹ nhớ kiên trì nhé! Bị sốt virus thông thường thì khi uống Siro Thiên Tri tích cực sẽ không bị đau rát họng nên không bỏ ăn, bé thì vẫn chịu chơi, đi tè nhiều hơn, chịu nằm ngủ được thành giấc và vẫn tương tác với mọi người.
